class Solution:
    def threeSum(self, nums):
        r = []
        ha = {}
        if not nums or len(nums) < 3:
            return r
        for i, num in enumerate(nums):
            target = -num
            h = {}
            for j, num2 in enumerate(nums):
                if j == i:
                    continue
                n = target - num2
                if n not in h:
                    h[num2] = j
                else:
                    a = [num, n, num2]
                    a.sort()
                    if str(a) not in ha:
                        r.append(a)
                        ha[str(a)] = 1
        return r


class Solution2:
    def threeSum(self, nums):
        r = []
        ha = {}
        nums.sort()
        if not nums or len(nums) < 3:
            return r
        
        for i, num in enumerate(nums):
            target = 0 - num
            left = i + 1
            right = len(nums) - 1
            while left < right:
                if nums[left] + nums[right] < target:
                    left = left + 1
                elif nums[left] + nums[right] > target:
                    right = right - 1
                else:
                    a = [num, nums[left], nums[right]]
                    a.sort()
                    if str(a) not in ha:
                        ha[str(a)] = 1
                        r.append(a)
                    left = left + 1
                    right = right - 1

        return r


